import React from "react";

import "./dropdown-card.styles.css";

const DropdownCard = () => {
  return (
    <div className="dropdown">
      <button class="dropbtn">Dropdown</button>
      <div class="dropdown-content">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
      </div>
    </div>
  );
};

export default DropdownCard;
